import { Component } from '@angular/core';
import { TopMenuComponent } from './top-menu/top-menu.component'
@Component({
  imports: [
    TopMenuComponent,
  ],
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'InmobiliriaWeb';
}
